import './Styles/App.css';
import RoutingSwitch from './BrowserRouter';


function App() {
  return (
  <div className='App-Container'>
    <header className='App-Header'>
      <div className='App-Header-Logo'>
        Company Logo
      </div>
      <ul className=''>
        <li>Home</li>
        <li>Shop</li>
        <li>Cart</li>
      </ul>
    </header>
    <RoutingSwitch />
  </div>
  );
}

export default App;
